  const onClick = () => {
    set_add_board_visibility("visible");
    setTimeout(() => {
      add_board_ref.current.focus();
    }, 100);
  };


  return (
    <button id="add-board-button" onClick={onClick} ref={ref}>+</button>
  )
});

